import React, { Component } from 'react';


class MyBidList extends Component {

    render() {

        return (
            <React.Fragment>
                {
                    this.props.bidTasks.map(task =>
                        <BidCard key={task.id} task={task} onPlaceBid={this.props.onPlaceBid} />
                    )
                }
            </React.Fragment>

        );
    }


}

export default MyBidList;
